import { useEffect } from "react";
import "./index.css";

function BookKind() {
    // const booksKindStart = () => {

    // }
    useEffect(() => {
        console.log("update");
    })

    return (
        <div className="kind">
            <div className="kind-book one">马克思主义、列宁主义、毛泽东思想、邓小平理论</div>
            <div className="kind-book two">哲学、宗教</div>
            <div className="kind-book three">社会科学总论</div>
            <div className="kind-book five">政治、法律</div>
            <div className="kind-book one">军事</div>
            <div className="kind-book two">经济</div>
            <div className="kind-book three">文化科学、教育、体育</div>
            <div className="kind-book five">语言、文字</div>
            <div className="kind-book one">文学</div>
            <div className="kind-book two">艺术</div>
            <div className="kind-book three">历史、地理</div>
            <div className="kind-book five">自然科学总论</div>
            <div className="kind-book one">数理科学和化学</div>
            <div className="kind-book two">天文学、地球科学</div>
            <div className="kind-book three">生物科学</div>
            <div className="kind-book five">医药、卫生</div>
            <div className="kind-book one">农业科学</div>
            <div className="kind-book two">工业技术</div>
            <div className="kind-book three">交通运输</div>
            <div className="kind-book five">航空、航天</div>
            <div className="kind-book one">环境科学、安全科学</div>
            <div className="kind-book two">综合性图书</div>
        </div>
    )
}

export default BookKind;
